import json
import pprint

class OrderBook():
    """Stores all information about order books for every currency pair"""
    def __init__(self):

        self.orderBook = {} # list of dict elements


    def initOrderBook(self, orderbook=None):
        """Initializes order book for provided currency sell and buy order books, previous values for that currency pair
        are cleared"""
        if not orderbook:
            return
        else:
            # self.orderBook = orderbook
            _currencyPair = orderbook.get('currencyPair')
            _orderbook_sell = orderbook.get('orderBook')[0]
            _orderbook_buy = orderbook.get('orderBook')[1]

            self.orderBook[_currencyPair] = { 'sell' : _orderbook_sell, 'buy' : _orderbook_buy}

            return self.orderBook

    def getCurrencyOrderBook(self, currencyPair = None):
        """Returns order book for selected currencyPair

        :currencyPair - string, refer to markets.py for exact names"""

        if not currencyPair:
            return
        else:
            return self.orderBook.get(currencyPair)

    def getWholeOrderBook(self):
        """Returns the whole order book"""
        return self.orderBook

    def clearWholeOrderBook(self):
        """Clears the whole order book"""
        self.orderBook = {}






